import React from "react";

export default function Portfolio() {
  return (
    <div className="portfolio">
      <div style={{ flexDirection: "column" }}>
        <ul>
          <li>The Deed</li>
          <li>Anthromes</li>
          <li>Material</li>
          <li>Personal Portfolio</li>
          <li>Simma</li>
          <li>Financial Auralizer</li>
          <li>Just Intonation</li>
        </ul>
      </div>
      <div style={{ flexDirection: "column" }}>IMAGE</div>
      <div style={{ flexDirection: "column" }}>DESCRIPTION</div>
    </div>
  );
}
